import React, { useState } from 'react';

const PopupMenu: React.FC = () => {
    const [showMenu, setShowMenu] = useState(false);

    const toggleMenu = () => {
        setShowMenu(!showMenu);
    };

    return (
        <div>
            <button onClick={toggleMenu}>...</button>
            {showMenu && (
                <div className="popup-menu">
                    <ul>
                        <li>Edit</li>
                        <li>Delete</li>
                    </ul>
                </div>
            )}
        </div>
    );
};

export default PopupMenu;
